import React, { useEffect, useState } from 'react';
import PropTypes from 'prop-types';
import clsx from 'clsx';
import moment from 'moment';
import { makeStyles } from '@material-ui/styles';
import {
  Card,
  CardHeader,
  CardContent,
  TextField,
  Button,
  Divider,
  Table,
  TableBody,
  TableRow,
  TableCell,
  ListItemSecondaryAction,
  Tooltip,
  IconButton,
  colors
} from '@material-ui/core';
import MaiIcon from '@material-ui/icons/MailOutline';
import ArrowForwardIcon from '@material-ui/icons/ArrowForwardOutlined';
import {  EnrollInProgram } from './components';

import { FETCH_VISITS , FETCH_VISITS_SERVICES, FETCH_LAST_SERVICE_PROVIDED, FETCH_ALL_VISIT_TYPES} from '../../../../../../graphql/queries/app-queries';
import { CREATE_SERVICES_OFFRED } from '../../../../../../graphql/mutations/app-mutations';

import  {apiFetchData , apiSaveData} from 'store/api-actions';
import {  useSelector  } from 'react-redux';
import { Label, GenericMoreButton } from 'components';





const useStyles = makeStyles(theme => ({
  root: {},
  content: {
    padding: 0
  },
  actions: {
    flexDirection: 'column',
    alignItems: 'flex-start',
    '& > * + *': {
      marginLeft: 0
    }
  },
  buttonIcon: {
    marginRight: theme.spacing(1)
  }
}));
const labelColors = {
  0: colors.green[600],
  1: colors.orange[600],
  2: colors.red[600]
};


const VisitServices = props => {
  const { customer, className, ...rest } = props;
  const [visits, setVisits] = useState([]);
  const [selectedVisit, setSelectedVisit] = useState([]);
  const [visitServices, setVisitServices] = useState([]);
  const [lastVisit, setLastVisit] = useState([]);

  const searParams = {
    id: '',
    userId: '',
    visitId: '',
  }


  const selectedUser  = useSelector((state) => ({ ...state.accessLevel.selectedUser }));



  const classes = useStyles();

  const options = [
    'Resend last invoice',
    'Send password reset',
    'Send verification'
  ];

  const fetchVisits = async () => {
    await apiFetchData(FETCH_VISITS).then(res =>{  
      setVisits(res.data.getVisits) 

    })
  }

  const fetchAllVisitsTypes = async () => {
    await apiFetchData(FETCH_ALL_VISIT_TYPES,'787').then(res =>{  
      console.log('fetchAllVisitsTypes :: ', res.data.getAllVisitTypes);
      setVisits(res.data.getAllVisitTypes) 

    })
  }


  const fetchVisitServices = async () => {
    await apiFetchData(FETCH_VISITS_SERVICES).then(res =>{  
      setVisitServices(res.data.getVisitServices) 

    })
  }

  const saveServicesOffred = async(payload) => {
    await  apiSaveData(payload,CREATE_SERVICES_OFFRED).then(res => {
      console.log('CREATE_SERVICES_OFFRED', res.data.postServicesProvided)
    })

  }

  const fetchLastServiceOffered = async (payload) => {
    await apiFetchData(FETCH_LAST_SERVICE_PROVIDED, payload ).then(res => {
      setLastVisit(res.data.getLastServiceProvided);
      console.log('getLastServiceProvided ', res.data.getLastServiceProvided)
    })
  }


  useEffect(() =>{
    //fetchVisits();
    fetchVisitServices();
    fetchAllVisitsTypes();


  },[]);


  const [option, setOption] = useState(options[0]);



  const [openEnrol, setOpenEnroll] = useState(false);




  const handleEditOpen = (event,data) => {
    console.log(data ,'Selected data data ',data)

    searParams.id = data.id;
    searParams.userId =selectedUser._id;
    searParams.visitId = data.id;

    console.log(data ,'Selected searParams ',searParams)

    setSelectedVisit(data);
    fetchLastServiceOffered(searParams);

    setOpenEnroll(true);
  };


  const handleEnrollClose = () => {
    setOpenEnroll(false);
  };
  const handleChange = event => {
    event.persist();

    setOption(event.target.value);
  };

  const saveService = (formState) => {

    saveServicesOffred(formState)


  }
  const onClickCalls = () =>{
    console.log('onClickCalls');

  }

  return (
    <Card
      {...rest}
      className={clsx(classes.root, className)}
    >
      <CardHeader title="Study Visits" />
      <Divider />
      <CardContent className={classes.content}>
        <TextField
          fullWidth
          name="option"
          onChange={handleChange}
          select
          // eslint-disable-next-line react/jsx-sort-props
          SelectProps={{ native: true }}
          value={option}
          variant="outlined"
        >
          {options.map(option => (
            <option
              key={option}
              value={option}
            >
              {option}
            </option>
          ))}
        </TextField>

        <Table className={classes.table}>
          <TableBody>
            {visits.map(visit => (
              <TableRow key={visit.id}>

                <TableCell className={classes.cell}>
                  {visit.visitName} 
                </TableCell>                
                <TableCell className={classes.cell}>
                  {moment.unix(visit.physicalVisits[0].visit_date/1000).format('DD-MM-YYYY')}
                </TableCell>
                <TableCell className={classes.cell}>
                  {visit.phoneCalls.length} Calls
                </TableCell>
                <TableCell className={classes.cell}>
                  {visit.description}
                </TableCell>
                <TableCell className={classes.cell}>
                  Window({visit.dayFromBaseDate})
                </TableCell>
                <TableCell onClick={onClickCalls}>
                  <Label
                    color={labelColors['0']}
                    variant="outlined"
                  >
                    calls

                  </Label>
                </TableCell>


                <TableCell className={classes.cell}>
                  <Tooltip title="View">
                    <IconButton
                      onClick={event =>
                        handleEditOpen(event, visit)

                      }
                      edge="end"
                      size="small"
                    >
                      <ArrowForwardIcon />
                    </IconButton>
                  </Tooltip>
                </TableCell>

              </TableRow>
            ))}
          </TableBody>
        </Table>
      </CardContent>      

      <EnrollInProgram
        visit={selectedVisit}
        visitServices = {visitServices}
        onClose={handleEnrollClose}
        open={openEnrol}
        saveService={saveService}
        lastVisit = {lastVisit}
      />
    </Card>
  );
};

VisitServices.propTypes = {
  className: PropTypes.string,
  //customer: PropTypes.object.isRequired
};

export default VisitServices;
